import { Box, Grid, Link, Typography, Toolbar, AppBar, IconButton } from '@mui/material';
import Logo from '../assets/Logo.png';
import React from 'react';
import '../styles/Navbar.css';
import { motion } from 'framer-motion';

function Navbar() {
  return (
    <div>
        <AppBar position="fixed" style={{ backgroundColor: 'transparent', boxShawdow: 'none' }}>
            <Toolbar>
                <IconButton edge="start" color="inherit" aria-label="menu">
                    <Logo />
                </IconButton>
                <Typography variant="h6">
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}
                    >
                        Home
                    </motion.div>
                </Typography>

                <Typography variant="h6">
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}
                    >
                        Portfolio
                    </motion.div>
                </Typography>

                <Typography variant="h6">
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}
                    >
                        About
                    </motion.div>
                </Typography>
            </Toolbar>
        </AppBar>
    </div>
  )
}

export default Navbar
